import React from 'react';
import ReactDOM from 'react-dom';
import {Router,Route} from 'react-router';
import loginPage from '../login/login';

const Routes=props=>(
  <Router {...props}>
    <Route path="/" component={loginPage} />
  </Router>
);

export default Routes;


